#!/usr/bin/perl

use strict;
use warnings;

use cifvirustotal;

use MIME::Base64;
use Data::Dumper;

#initialize the plugin with the VT api key
my $cifvt = cifvirustotal::new({apikey=>'your VT key here'});


# a base64 encoded binary, which should be an extra hash in CIF-stored MMDEF messages
my $base64_binary = "";
# scanning binary data also requires the original filename, which is also in the MMDEF message
my $filename = "ACH_transaction_details_ID_5466767439823749865983614972300000000000005863028462085623740318740238574085723046240586230408234082.pdf.exe";

# this submits the binary to the VT API and returns the response
my $res = $cifvt->scan_binary_string({filename=>$filename,binarydata=>decode_base64($base64_binary)});

# catch any errors submitting (bad API key, excessive requests, etc)
die("error submitting to API ".Dumper($res)) unless($res->{'response_code'});

#record the resource record to check back later
my $resource_id = $res->{'resource'};


#retrieve the file report - keep checking until scan is complete
$res = $cifvt->retrieve_file_report($resource_id);
while (!$res->{'response_code'} || $res->{'response_code'}!=1){
	print $res->{'verbose_msg'}."\n";
	sleep(15);
	$res = $cifvt->retrieve_file_report($resource_id);
}
my $protobuf = $cifvt->to_protobuf(); #returns an mmdef protobuf of the results (binary)

print Dumper($res);



#how to scan a URL

$res = $cifvt->scan_url('https://dl.dropbox.com/u/10394183/malware.zip');

# catch any errors submitting (bad API key, excessive requests, etc)
die("error submitting to API ".Dumper($res)) unless($res->{'response_code'});

#record the resource record to check back later
my $scan_id = $res->{'scan_id'};


#retrieve the file report - keep checking until scan is complete
$res = $cifvt->retrieve_url_report($scan_id);
while (!$res->{'response_code'} || $res->{'response_code'}!=1){
	print $res->{'verbose_msg'}."  Scan ID = $scan_id\n";
	sleep(60);
	$res = $cifvt->retrieve_url_report($scan_id);
}
my $protobuf = $cifvt->to_protobuf(); #returns an mmdef protobuf of the results (binary)
print Dumper($res);
